#! /bin/bash
# generated by generate_git_fetch_script.sh

pushd $(dirname $0)                                                                                     2> /dev/null   > /dev/null

if ! test -d "./\!descriptions" ; then
  mkdir "./\!descriptions"
fi
pwd



function check_github_api_output {
    if test -s "$1" ; then
        if $( grep -e "API rate limit exceeded for " "$1"  2> /dev/null   > /dev/null ) ; then
            echo "github API rate limiting detected..."
            rm -f "$1"
        fi
    fi
}

function gist_add {
    local full_uri=$( printf "https://gist.github.com/%s.git" "$1" );
    local dir_path=$( printf "gist-%s" "$1" );
    echo "gist: full_uri = ${full_uri}, dir_path = ${dir_path}"

    if test "$mode" != "U" -a "$mode" != "QU" ; then
        if test -s "${dir_path}/.git/index" ; then
            pushd .                                                                                     2> /dev/null   > /dev/null
            cd ${dir_path}
            git pull --all
            popd                                                                                        2> /dev/null   > /dev/null
        else
            rm -rf ${dir_path}                                                                          2> /dev/null   > /dev/null
            echo git clone ${full_uri} ${dir_path}
            git clone ${full_uri} ${dir_path}
        fi
    fi
    if test "$mode" = "W" ; then
        git_register_remote_for_UnixVM ${full_uri} ${dir_path}
    fi

    check_github_api_output "./\!descriptions/${dir_path}.txt"
    delay=1
    while ! test -s "./\!descriptions/${dir_path}.txt" ; do
        echo curl -o "./\!descriptions/${dir_path}.txt" https://api.github.com/gists/$1
        curl -o "./\!descriptions/${dir_path}.txt" https://api.github.com/gists/$1
        check_github_api_output "./\!descriptions/${dir_path}.txt"
        if  ! test -s "./\!descriptions/${dir_path}.txt" ; then
            echo "sleep $delay"
            sleep $delay
            delay=$(expr \( $delay \< 1000 \) \* $delay \* 2 + \( $delay \>= 1000 \) \* 1000 )
        fi
        if test "$mode" = "QU" ; then
            break
        fi
    done
    touch "./\!descriptions/${dir_path}.txt"

    cat "./\!descriptions/${dir_path}.txt" | gawk -f ./git_clone_all_examples.awk -v gist=$1 >> htmldestination.html.bak
}

function github_add {
    local full_uri=$( printf "git@github.com:%s.git" "$1" );
    local dir_path=$( printf "github.%s" "$1" | sed -e "s/[^a-zA-Z0-9_.-]\+/./g" -e "s/\.\+/./g" );
    echo "github: full_uri = ${full_uri}, dir_path = ${dir_path}"

    if test "$mode" != "U" -a "$mode" != "QU" ; then
        if test -s "${dir_path}/.git/index" ; then
            pushd .                                                                                     2> /dev/null   > /dev/null
            cd ${dir_path}
            git pull --all
            popd                                                                                        2> /dev/null   > /dev/null
        else
            rm -rf ${dir_path}                                                                          2> /dev/null   > /dev/null
            echo git clone ${full_uri} ${dir_path}
            git clone ${full_uri} ${dir_path}
        fi
    fi
    if test "$mode" = "W" ; then
        git_register_remote_for_UnixVM ${full_uri} ${dir_path}
    fi

    check_github_api_output "./\!descriptions/${dir_path}.txt"
    delay=1
    while ! test -s "./\!descriptions/${dir_path}.txt" ; do
        echo curl -o "./\!descriptions/${dir_path}.txt" https://api.github.com/repos/$1
        curl -o "./\!descriptions/${dir_path}.txt" https://api.github.com/repos/$1
        check_github_api_output "./\!descriptions/${dir_path}.txt"
        if  ! test -s "./\!descriptions/${dir_path}.txt" ; then
            echo "sleep $delay"
            sleep $delay
            delay=$(expr \( $delay \< 1000 \) \* $delay \* 2 + \( $delay \>= 1000 \) \* 1000 )
        fi
        if test "$mode" = "QU" ; then
            break
        fi
    done
    touch "./\!descriptions/${dir_path}.txt"

    cat "./\!descriptions/${dir_path}.txt" | gawk -f ./git_clone_all_examples.awk -v github=$1 >> htmldestination.html.bak
}


function git_register_remote_for_UnixVM {
    if test -d "$2" ; then
        if test -d "$Win7DEV_BASEDIR/$2" ; then
            pushd $2                                                                                    2> /dev/null  > /dev/null
            git remote remove Win7DEV
            git remote add Win7DEV $Win7DEV_BASEDIR/$2
            popd                                                                                        2> /dev/null  > /dev/null
        fi
    fi
}

getopts ":Wufh" opt
#echo opt+arg = "$opt$OPTARG"
case "$opt$OPTARG" in
W )
  echo "--- registering Win7DEV as remote ---"
  mode="W"
  for (( i=OPTIND; i > 1; i-- )) do
    shift
  done
  #echo args: $@
  if test -d "$1" ; then
    Win7DEV_BASEDIR=$1
  fi
  ;;

u )
  echo "--- only updating the index file ---"
  mode="U"
  for (( i=OPTIND; i > 1; i-- )) do
    shift
  done
  #echo args: $@
  ;;

f )
  echo "--- only updating the index file ---"
  mode="QU"
  for (( i=OPTIND; i > 1; i-- )) do
    shift
  done
  #echo args: $@
  ;;

"?" )
  echo "--- registering D3 example git repositories ---"
  mode="R"
  ;;

* )
  cat <<EOT
$0 [-W <optional_remote_path>]

set up all D3 example git repositories.

-u       : only regenerate/update the index HTML file from the already loaded records

-u       : like '-u' but does retry fetching metadata from github for each repo

-W       : set up 'Win7DEV' remote reference per repository

           When you don't specify the remote path yourself,
           the default is set to:
             "$Win7DEV_BASEDIR"

EOT
  exit
  ;;
esac




